    true,nt"url": null,nt"notes": "The Portland data environment provides the
    following data: (a) Freeway data consisting of two months of data from dual-loop
    detectors deployed in the main line and on-ramps of a Portland-area freeway (I-205),
    (b) Incident data from the Oregon Department of Transportation Advanced Traffic
    Management System database and planned event data from the ODOT Trip-Check Traveler
    Information Portal information web site, (c) Weather data from two sources: NOAA
    data and Remote Weather Information System (RWIS) station data, (d) Three types
    of arterial data: (1) Volume and occupancy data from four single loop detectors
    on 82nd Ave., (2) Signal phase and timing data for 32 signals along the 82nd Avenue
    corridor, (3) Travel times on 82nd Ave., computed from data collected by two Bluetooth
    readers, and (e) Transit data provided from TriMet, the Portland-metro area transit
    agency, including schedule, stop event and passenger counts data for both bus and
    light rail.",nt"license_title": "Other License Specified",nt"extras":
